import { Routes, Route } from "react-router-dom";
import Bookings from "./pages/Bookings";
import Home from "./pages/Home";
import "./style.css";
import Navbar from "./components/Navbar";
import BookingsContextProvider from "./Context/BookingsContextProvider";
import SlotsContextProvider from "./Context/SlotsContextProvider";

function App() {
  return (
    <div className="App">
      <Navbar />
      <BookingsContextProvider>
        <SlotsContextProvider>
          <Routes>
            <Route path="/" Component={()=>{return (
              <div>
                <BookingsContextProvider>
              <SlotsContextProvider>
            <Bookings />
            </SlotsContextProvider>
            </BookingsContextProvider>
              </div>
            )}}></Route>
            <Route path="/bookings" Component={()=>{return (
              <BookingsContextProvider>
              <SlotsContextProvider>
            <Bookings />
            </SlotsContextProvider>
            </BookingsContextProvider>
            )}}></Route>
          </Routes>
        </SlotsContextProvider>
      </BookingsContextProvider>
    </div>
  );
}

export default App;
